import 'device.dart';class Personel {  String id;  String name;  String subeId;  String solBileklikId;  String sagBileklikId;  Device? solBileklik;  Device? sagBileklik;  Personel({    required this.id,    required this.name,    required this.subeId,    required this.solBileklikId,    required this.sagBileklikId,     this.solBileklik,     this.sagBileklik,  });  factory Personel.fromJson(Map<String, dynamic> json) {    return Personel(      id: json['id'],      name: json['name'],      subeId: json['subeId'],      solBileklikId: json['sol_bileklik_id'],      sagBileklikId: json['sag_bileklik_id'],      solBileklik: json['solBileklik'] == null ? null :Device.fromJson(Map<String,dynamic>.from(json['solBileklik'] as Map? ?? {})),      sagBileklik: json['sagBileklik'] == null ? null :Device.fromJson(Map<String,dynamic>.from(json['sagBileklik'] as Map? ?? {})),    );  }  Map<String, dynamic> toJson() {    return {      'id': id,      'name': name,      'subeId': subeId,      'sol_bileklik_id': solBileklikId,      'sag_bileklik_id': sagBileklikId,      'solBileklik': solBileklik?.toJson(),      'sagBileklik': sagBileklik?.toJson(),    };  }}